124 b 2 gomadh mó choindeobham :
‘ potius teneamus ’ , ‘ let us rather hold ’ , an imperative parallel to ‘ deprecemur ’ which is translated is jonghérghuidhe dhvínn ;
the Gaelic looks like a future . The - nd - ( which presumably here as usual equals - nn - ) for - ng - is frequent in forms of congbhail in this text . There is , however , as yet no suggestion of Scottish Gaelic ( and Manx ) cumail .

