176 b 1 an vimhirse :
‘ numerus hic ’ ; like Welsh nifer , Med . Welsh niuer , this is a borrowing of Latin numerus . The initial n - has been taken as part of the article and the word made to begin with a vowel , perhaps under the influence of the native term áireamh ;
then , since no t - follows the article in the nom . sg . the noun must be feminine , whereas Welsh niuer remained masculine .

