205 b 3 timchiollaighe :
for timchiollaighthe ,
gen . of timchiollughadh ;
the senses quoted for this word and for timchellad in Contr . seem generally to be more concrete , as in 70 b 2 and 315 b 5 , rather than the metaphorical ‘ circumvent , overreach ’ required here , but cf . Contr . s . v . timchell ( III f ) .

